import { Component, OnChanges, OnInit, SimpleChanges } from '@angular/core';
import { ArtistPhotoService } from 'src/app/services/artist-photo/artist-photo.service';
import { ContinueLyricsService } from 'src/app/services/continue-lyrics-service/continue-lyrics.service';
import { GuessArtistService } from 'src/app/services/guess-artist-service/guess-artist.service';
import { ArtistPhotoInterface } from 'src/interfaces/artist-photo.interface';
import { ContinueLyricsInterface } from 'src/interfaces/continue-lyrics.interface';
import { GuessArtistInterface } from 'src/interfaces/guess-artist.interface';

@Component({
  selector: 'app-quiz',
  templateUrl: './quiz.component.html',
  styleUrls: ['./quiz.component.css'],
})
export class QuizComponent implements OnInit, OnChanges {
  question1: ContinueLyricsInterface = {
    o1: '',
    o2: '',
    o3: '',
    song: '',
    solution: '',
    id: 0,
  };

  question2: GuessArtistInterface = {
    o1: '',
    o2: '',
    o3: '',
    song: '',
    solution: '',
    id: 0,
  };

  question3: ArtistPhotoInterface = {
    o1: '',
    o2: '',
    o3: '',
    url: '',
    solution: '',
    id: 0,
  };
  selectedOption: string = '';
  constructor(
    private lyricsService: ContinueLyricsService,
    private guessArtistService: GuessArtistService,
    private artistPhotoService: ArtistPhotoService
  ) {}

  ngOnChanges(changes: SimpleChanges) {
    if (changes['question3']) {
      // Ažurirajte stil pozadine div elementa svaki put kada se promeni question1
      this.updateBackgroundStyle();
    }
  }

  private updateBackgroundStyle() {
    const width = '200';
    const height = '200';

    const imageUrl = `./assets/store-photos/${this.question3.url}`;
    console.log('ovde');
    const backgroundDiv = document.getElementById('background-div');
    if (backgroundDiv) {
      // Postavite pozadinu div elementa koristeći JavaScript
      backgroundDiv.style.backgroundImage = `url('${imageUrl}')`;
      backgroundDiv.style.backgroundSize = 'cover';
      backgroundDiv.style.backgroundPosition = 'center';
      backgroundDiv.style.width = '20vw';
      backgroundDiv.style.height = '20vw';
    }
  }

  ngOnInit(): void {
    this.updateBackgroundStyle();
    this.lyricsService
      .getContinueLyrics()
      .subscribe((data: ContinueLyricsInterface) => {
        this.question1 = data;
      });
    this.guessArtistService
      .getGuessTheArtist()
      .subscribe((data: GuessArtistInterface) => {
        this.question2 = data;
      });
    this.artistPhotoService
      .getArtistPhoto()
      .subscribe((data: ArtistPhotoInterface) => {
        this.question3 = data;
      });
  }
}
<div class="quiz">
    <div class="continueLyrics">
        <label>Continue the lyrics</label><br>
        <label>{{question1.song}}</label>
        <div>
            <label>
                <input type="radio" name="option" [(ngModel)]="selectedOption" value="option1"> {{question1.o1}}
            </label>
        </div>
        <div>
            <label>
                <input type="radio" name="option" [(ngModel)]="selectedOption" value="option2"> {{question1.o2}}
            </label>
        </div>
        <div>
            <label>
                <input type="radio" name="option" [(ngModel)]="selectedOption" value="option3"> {{question1.o3}}
            </label>
        </div>
    </div>

    <div class="guessArtist">
        <label>Guess the Artist</label><br>
        <label>Song: {{question2.song}}</label>
        <div>
            <label>
                <input type="radio" name="option" [(ngModel)]="selectedOption" value="option4"> {{question2.o1}}
            </label>
        </div>
        <div>
            <label>
                <input type="radio" name="option" [(ngModel)]="selectedOption" value="option5"> {{question2.o2}}
            </label>
        </div>
        <div>
            <label>
                <input type="radio" name="option" [(ngModel)]="selectedOption" value="option6"> {{question2.o3}}
            </label>
        </div>
    </div>

    <div class="artistPhoto">
        <label>Recognize the Artist</label><br>
        <div id="background-div">
.
        </div>
        <!-- <img [src]="'../../../../assets/store-photos/'+question3.url" alt="img"> -->
        <div>
            <label>
                <input type="radio" name="option" [(ngModel)]="selectedOption" value="option7"> {{question3.o1}}
            </label>
        </div>
        <div>
            <label>
                <input type="radio" name="option" [(ngModel)]="selectedOption" value="option8"> {{question3.o2}}
            </label>
        </div>
        <div>
            <label>
                <input type="radio" name="option" [(ngModel)]="selectedOption" value="option9"> {{question3.o3}}
            </label>
        </div>
    </div>
    <div class="result">

    </div>
</div>
